  data: "",
  clickedFood: "",
  totalPrice: 0,
  isOverMinimum: false,
}
const LOGIN = "LOGINREDUCER/LOGIN";
const LOGOUT = "LOGINREDUCER/LOGOUT";

export const cartReducer = createSlice({
  name: 'cartReducer',
  initialState: initialState,

});
